''' QUESTION DESCRIPTION:

You are given an integer array height of length n. 
There are n vertical lines drawn such that the two endpoints of the ith line are (i, 0) and (i, height[i]).


endpoint:
    [1]             (i, 0) : the start of the column-line -> number i column starts at 0 height  (IT WILL ALLWAYS START AT 0)
    [2]     (i, height[i]) : the end of the column-line -> number i column starts at height[i] (height of i)  

'''


class Solution:
    '''
    *Not my original answer, Answer is taken from other peoples Solutions
    '''
    def maxArea(self, height: list[int]) -> int:
        left = 0
        right = len(height)-1
        maxAera = 0 
        if len(height) == 2:
            return 1*min(height[left],height[right]) 

        while left < right:
                currentArea = min(height[left],height[right]) * (right-left)
                if currentArea > maxAera:
                    maxAera = currentArea

                if height[left]<height[right]:
                     left+=1
                else:
                     right-=1
        return maxAera


        








